import React from "react";

// -----------------------------------------
// Compound Component Setup
// -----------------------------------------
const Login= ({ children }) => {
  return (
    <div style={styles.card}>
      {children}
    </div>
  );
};

LoginCard.Title = function Title({ children }) {
  return <h2 style={styles.title}>{children}</h2>;
};

LoginCard.Field = function Field({ label, ...props }) {
  return (
    <div style={styles.fieldContainer}>
      <label style={styles.label}>{label}</label>
      <input style={styles.input} {...props} />
    </div>
  );
};

LoginCard.Button = function Button({ children }) {
  return <button style={styles.button}>{children}</button>;
};

// -----------------------------------------
// Styles
// -----------------------------------------
const styles = {
  page: {
    background: "#0f0e11",
    minHeight: "100vh",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  card: {
    background: "#1a1a1d",
    padding: "32px",
    width: "380px",
    borderRadius: "12px",
    boxShadow: "0 0 12px rgba(0,0,0,0.4)",
  },
  title: {
    color: "#ffffff",
    textAlign: "center",
    marginBottom: "28px",
    fontWeight: "500",
  },
  fieldContainer: {
    display: "flex",
    flexDirection: "column",
    marginBottom: "18px",
  },
  label: {
    color: "#ff7029",
    fontSize: "13px",
    marginBottom: "6px",
  },
  input: {
    background: "#2c2c2f",
    border: "1px solid #3a3a3d",
    padding: "12px",
    color: "#ffffff",
    borderRadius: "6px",
    outline: "none",
  },
  button: {
    width: "100%",
    background: "#ff7029",
    color: "#ffffff",
    padding: "12px",
    borderRadius: "6px",
    border: "none",
    fontSize: "15px",
    marginTop: "10px",
    cursor: "pointer",
  },
};

// -----------------------------------------
// Example Usage
// -----------------------------------------
export default function App() {
  return (
    <div style={styles.page}>
      <LoginCard>
        <LoginCard.Title>Log in</LoginCard.Title>

        <LoginCard.Field
          label="USER NAME"
          placeholder="Enter your user name"
        />

        <LoginCard.Field
          label="USER NAME"
          placeholder="Enter your user name"
        />

        <LoginCard.Button>Log in</LoginCard.Button>
      </LoginCard>
    </div>
  );
}
